//@ts-nocheck
import React from 'react';
import {Col, Panel, Row} from 'rsuite';
import BarChart from './BarChart';
import PieDonutChart from './PieDonutChart';
import RadialChart from './RadialChart';


export type CardSection3Props={
  RadarData:any
  PieDonutChartData:any
  BarChartData:any
}


const Card = props => (
  <Panel {...props} bordered shaded  bodyFill style={{width:'80%', backgroundColor:"white" , margin:"30px",marginLeft:"40px"}}>

  </Panel>
);

const CardSection3 = (props: CardSection3Props)=>{
return (
  <Row>
    <Col md={8} sm={12}>
      <Card  ><div style={{height:"500px"}}>
        <RadialChart
        RadarData={props?.RadarData}/>
        </div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
        <PieDonutChart
        PieDonutChartData={props?.PieDonutChartData}/>
        </div></Card>
    </Col>
    <Col md={8} sm={12}>
      <Card ><div style={{height:"500px"}}>
        <BarChart
        BarChartData={props?.BarChartData}/>
        </div></Card>
    </Col>

  </Row>
);
}

export default CardSection3;
